It never gets old, being in a room full of honest women who don’t want the fanfare, they just want Jesus. We worshipped, we baptised, we said inappropriate things (ok fine, I said inappropriate things — see slide 2 — but whatever, Tori thought it was funny 🤷🏼‍♀️😂). 
@torihopepetersen, you are grace in human form. @lovedalreadyconference you are some of my favourite women ever. Leaving very full. 🤍

